INSERT INTO `v1_2e9b7974577f4554722366c1b085e3f86f0fb81e94fca833aaca39000f647263` VALUES ("", "---", 1, 0, 2, "アサヒ", 6000, 1, "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", 3);
INSERT INTO `v1_2e9b7974577f4554722366c1b085e3f86f0fb81e94fca833aaca39000f647263` VALUES ("ホームランを連発すると、連発数に応じてパワーアップする", "アドレナリン", 3, 3, 3, "部員3", 16000, 1, "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", 0);
INSERT INTO `v1_2e9b7974577f4554722366c1b085e3f86f0fb81e94fca833aaca39000f647263` VALUES ("幸運のハプニングを呼び込む", "ラッキー", 2, 2, 4, "{0}", 30000, 1, "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", 2);
